import { Typography } from "@mui/material";
import PhoneEnabledIcon from "@mui/icons-material/PhoneEnabled";
import MailIcon from "@mui/icons-material/Mail";
import React from "react";
import FacebookIcon from "@mui/icons-material/Facebook";

function Footer(props) {
  return (
    <div style={{ backgroundColor: "#ffcc38" }}>
      <div
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          padding: 15,
          flexWrap: "wrap",
        }}
      >
        <div style={{ width: 400, border: "2px solid red" }}>
          <Typography variant="h6">About Us</Typography>
          <Typography>
            Ad exercitation et adipisicing excepteur esse sunt veniam voluptate
            labore sint.
          </Typography>
        </div>
        <div style={{ width: 400, border: "2px solid red" }}>
          <Typography variant="h6">Contact Us</Typography>
          <div>
            <div style={{ display: "flex" }}>
              <PhoneEnabledIcon />
              <Typography style={{ marginLeft: 5 }}> +91-9895125225</Typography>
            </div>
            <div style={{ display: "flex" }}>
              <MailIcon />
              <Typography style={{ marginLeft: 5 }}>
                {" "}
                support@granth.com
              </Typography>
            </div>
          </div>
        </div>
        <div style={{ width: 400, border: "2px solid red" }}>
          <Typography variant="h6">Social | Partners | Carrers in</Typography>
          <div>
            <FacebookIcon />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
